import  "./sm.css"

export default function Sm4() {
  return (
    <div >
      <h3 className="title">Mental healings in ancient times</h3>
      <ul>
        <li>Believe and accept as true that our desire has already been accomplished and fulfilled, that it is already completed, and its realisation will follow as a thing in the future</li>
        <li>The process of all healing is a definite, positive, mental attitude an inner attitude or a way of thinking called faith</li>
        <li>Faith is like a seed planted in the ground. Plant the idea in your mind, water and fertilise it with expectancy and it will manifest</li>
      </ul>
    </div>
  )
}
